def encrypt():
    if tkinter.messagebox.askyesno("WannaDoge", "Do you want to encrypt ALL the files in your current directory?") == False:
        return
    key = Fernet.generate_key()
    files = [f for f in os.listdir('.') if os.path.isfile(f)]
    for f in files:
        if f == "KEY.txt" or "icon.ico": #  We can't encrypt our key, can we? :)
            pass
        else:
            fer = Fernet(key)
            with open(f, "rb") as fi:
                enc = fer.encrypt(fi.read())
            with open(f, "wb") as fi:
                fi.write(enc)
    with open("KEY.txt", "wb") as f:
        f.write(key)
    tkinter.messagebox.showinfo("WannaDoge", "Finished.")
    return 0

def decrypt():
    keyP = tkinter.filedialog.askopenfilename(title="Select key file.")
    print(keyP)
    if os.path.isfile(keyP) == False:
        tkinter.messagebox.showwarning("WannaDoge", "File path does not exist.")
        return
    fernet = Fernet(open(keyP, "rb").read())
    files = [f for f in os.listdir('.') if os.path.isfile(f)]
    for f in files:
        if f == "KEY.txt":
            pass
        else:
            with open(f, "rb") as fi:
                dec = fernet.decrypt(fi.read())
            with open(f, "wb") as fi:
                fi.write(dec)

